import React from 'react';
import 'antd/dist/antd.css';
import './index.css';
import {
    Form,
    Select,
    Button,
    Upload,
 Input,
} from 'antd';
import {  InboxOutlined } from '@ant-design/icons';
import {Option} from "antd/es/mentions";
import {uploadfile} from "./wortwhile";
const formItemLayout = {
    labelCol: {
        span: 6,
    },
    wrapperCol: {
        span: 14,
    },
};

const normFile = (e) => {
    console.log('Upload event:', e);

    if (Array.isArray(e)) {
        return e;
    }

    return e && e.fileList;
};

const Demo = () => {
    const onFinish = (values) => {
        console.log('Received values of form: ', values);
    };
    const submitForm = () => {
        const formData = new FormData();
        formData.append("name", name);
        formData.append("file", normFile);
        console.log(normFile)
        console.log(onFinish)
        let t = uploadfile(onFinish)
        console.log(t)
    };

    return (
        <Form
            name="validate_other"
            {...formItemLayout}
            onFinish={onFinish}
        >
            <Form.Item
                {...formItemLayout}
                name="projectName"
                label="Your project name"
                rules={[
                    {
                        required: true,
                        message: 'Please input your project name',
                    },
                ]}
            >
                <Input placeholder="Please input your project name" />
            </Form.Item>
            <Form.Item
                name="select"
                label="Select"
                hasFeedback
                rules={[
                    {
                        required: true,
                        message: 'Please input your type',
                    },
                ]}
            >
                <Select placeholder="Please input your type">
                    <Option value="file">File</Option>
                    <Option value="repo">Repo</Option>
                </Select>
            </Form.Item>
            <Form.Item
                {...formItemLayout}
                name="linkRepo"
                label="Link Repo"
            >
                <Input placeholder="Please input link repo" />
            </Form.Item>
            <Form.Item label="Dragger">
                <Form.Item name="dragger" valuePropName="fileList" getValueFromEvent={normFile} noStyle>
                    <Upload.Dragger name="files" beforeUpload={() => false}>
                        <p className="ant-upload-drag-icon">
                            <InboxOutlined />
                        </p>
                        <p className="ant-upload-text">Click or drag file to this area to upload</p>
                        <p className="ant-upload-hint">Support for a single or bulk upload.</p>
                    </Upload.Dragger>
                </Form.Item>
            </Form.Item>

            <Form.Item
                wrapperCol={{
                    span: 12,
                    offset: 6,
                }}
            >
                <Button type="primary" htmlType="submit" onClick={submitForm} >
                    Submit
                </Button>
            </Form.Item>
        </Form>
    );
};

export default Demo
